import {
  GoogleMap,
  useLoadScript,
  Marker,
  InfoWindow,
} from "@react-google-maps/api";

export default function Stops(props) {
  return props.data.map((stop) => (
    <>
      <button onClick={() => console.log(stop[0].stop_name)}></button>
    </>
  ));
}
